import React from "react";
import { ICard } from "./types/types";
import { cardsContent } from "./cards-base";

const CardContext = React.createContext<ICard[]>(cardsContent);

const cardsContentContext: ICardsContext = {
  value: cardsContent,
};

export { CardContext, cardsContentContext };
